import React, {useState, useEffect} from 'react';

export const History = () => {
    const [data,setData]=useState([]);
    const county = "Sonoma";
    const getData = () => {
        fetch('http://localhost:3001/fires?Counties=' + county)
        .then(response => response.json())
        .then(data => setData(data));
    }

    useEffect(()=>{
        getData();
    },[])

    return(<p>hi</p>);
}
